define({"topics":[{"title":"Airshell Common Commands","shortdesc":"<p class=\"shortdesc\">For <span class=\"ph\">Airwall Gateways<\/span>         that have a console port, you can deploy and configure the <span class=\"ph\">Airwall Gateway<\/span> with the             <strong class=\"ph b\">Airshell<\/strong> (airsh) command-line interface. You can deploy &amp; configure an <span class=\"ph\">Airwall Gateway<\/span> directly         without going into diagnostic mode.<\/p>","href":"content\/topics\/aw_install_airsh_focused.html","attributes":{"data-id":"aw_install_airsh_focused"},"menu":{"hasChildren":false},"tocID":"aw_install_airsh_focused-d10823e10264","topics":[]},{"title":"<span class=\"ph\" id=\"titlelink\">Airshell (<span class=\"ph\"><code class=\"ph codeph\">airsh<\/code><\/span>) Command Reference<\/span>","shortdesc":"<p class=\"shortdesc\">For <span class=\"ph\">Airwall Gateways<\/span> that         have a console port, and for Linux <span class=\"ph\">Airwall Servers<\/span> you can deploy         and configure them with the <span class=\"ph\">Airshell<\/span> (<span class=\"ph\"><code class=\"ph codeph\">airsh<\/code><\/span>) command-line interface. It         provides tab-completion, inline help, and the ability to deploy and configure directly         without going into diagnostic mode.<\/p>","href":"content\/topics\/aw_airsh_cmd.html","attributes":{"data-id":"hipswitch_console_cmd"},"menu":{"hasChildren":false},"tocID":"hipswitch_console_cmd-d10823e10287","next":"hipswitch_console_cmd-d10823e10287"},{"title":"<span class=\"ph\">Airshell<\/span> table command","shortdesc":"<p class=\"shortdesc\">Full details for the <span class=\"ph\">Airshell<\/span> table         command<\/p>","href":"content\/topics\/airsh_diag_table.html","attributes":{"data-id":"airsh_diag_table"},"menu":{"hasChildren":false},"tocID":"airsh_diag_table-d10823e10367","topics":[]},{"title":"Linux <span class=\"ph\">Airwall Server<\/span>  <span class=\"ph\">Airshell<\/span> commands","shortdesc":"<p class=\"shortdesc\">These are the common <span class=\"ph\">Airshell<\/span> commands for the Linux             <span class=\"ph\">Airwall Server<\/span>.<\/p>","href":"content\/topics\/airsh_for_servers.html","attributes":{"data-id":"airsh_for_servers"},"menu":{"hasChildren":false},"tocID":"airsh_for_servers-d10823e10383","topics":[]},{"title":"Run <span class=\"ph\">Airshell<\/span> remotely from the <span class=\"ph\">Conductor<\/span>","shortdesc":"<p class=\"shortdesc\">For remote administration of <span class=\"ph\">Airwall Gateways<\/span>, you can use <span class=\"ph\">Airshell<\/span> to run diagnostic and         configuration commands from the <span class=\"ph\">Conductor<\/span>.<\/p>","href":"content\/topics\/airsh_remote_cond.html","attributes":{"data-id":"airsh_remote_cond"},"menu":{"hasChildren":false},"tocID":"airsh_remote_cond-d10823e10414","topics":[]},{"title":"Set up Remote Access to <span class=\"ph\">Airshell<\/span> via SSH","shortdesc":"<p class=\"shortdesc\">You can enable and set up a secure shell (SSH) public key on physical <span class=\"ph\">Airwall Gateways<\/span> to allow you to         remotely log in to run <code class=\"ph codeph\">airsh<\/code> commands. Remote access is limited to running             <code class=\"ph codeph\">airsh<\/code> commands, and only to the <span class=\"ph\">Overlay<\/span> IPs, not any             <span class=\"ph\">Underlay<\/span> IPs.         Remote access uses SSH public\/private key pairs, where the <span class=\"ph\">Airwall Gateways<\/span> only see the         public key. <\/p>","href":"content\/topics\/airsh_remote_access.html","attributes":{"data-id":"airsh_remote_access"},"menu":{"hasChildren":false},"tocID":"airsh_remote_access-d10823e10439","topics":[]},{"title":"Access an <span class=\"ph\">Airwall Gateway<\/span> Remotely","shortdesc":"<p class=\"shortdesc\">Once you've <a class=\"xref\" href=\"content\/topics\/airsh_remote_access.html\">content\/topics\/airsh_remote_access.html<\/a> on an <span class=\"ph\">Airwall Gateway<\/span>, you can use         the configured SSH key to log in remotely and run a limited set of <code class=\"ph codeph\">airsh<\/code>         commands with airsh as a username.<\/p>","href":"content\/topics\/airsh_remote_ssh.html","attributes":{"data-id":"airsh_remote_ssh"},"menu":{"hasChildren":false},"tocID":"airsh_remote_ssh-d10823e10480","topics":[]},{"title":"Configure an <span class=\"ph\">Airwall Gateway<\/span> with the <span class=\"ph\"><code class=\"ph codeph\">airsh<\/code><\/span> Setup Wizard","shortdesc":"<p class=\"shortdesc\">Configure the most common <span class=\"ph\">Airwall Gateway<\/span> setup options         using the <span class=\"ph\"><code class=\"ph codeph\">airsh<\/code><\/span> Setup Wizard. <\/p>","href":"content\/topics\/airsh_setup-ui_2.html","attributes":{"data-id":"airsh_setup-ui"},"menu":{"hasChildren":false},"tocID":"airsh_setup-ui-d10823e10510","topics":[]},{"title":"Configure Port Groups with <span class=\"ph\">Airshell<\/span>","shortdesc":"<p class=\"shortdesc\">You can use Airshell to add, delete, and configure port groups on an <span class=\"ph\">Airwall Gateway<\/span>, including         adding an <span class=\"ph\">Overlay<\/span>         IP.<\/p>","href":"content\/topics\/airsh_config_port_groups.html","attributes":{"data-id":"airsh_config_port_groups"},"menu":{"hasChildren":false},"tocID":"airsh_config_port_groups-d10823e10546","topics":[]},{"title":"Do network discovery and security audits in <span class=\"ph\">Airshell<\/span> (nmap)","shortdesc":"<p class=\"shortdesc\">Map your network for discovery or security audits with the <span class=\"ph\">Airshell<\/span> command             <code class=\"ph codeph\">nmap<\/code>.<\/p>","href":"content\/topics\/airsh_nmap.html","attributes":{"data-id":"airsh_nmap"},"menu":{"hasChildren":false},"tocID":"airsh_nmap-d10823e10576","topics":[]}]});